import React from 'react'
import styled from 'styled-components'

const Wrap = styled.div `
    display: flex;
    justify-content: center;
`
const Skill = styled.div `
    border: 1px solid white;
    width: 80%;
    height: 100%;
`

const Skills = () => {
    return (
        <Wrap>
            <Skill>
            <i class="fab fa-html5"></i>
            </Skill>
        </Wrap>
    )
}
export default Skills;
